  console.log(films)
  return (
     films === null ? <Spinner /> : 

        // {films !== null ? (   
        <Fragment>
        <h1 className="displayHeader">Your films</h1>
        <div className="displayDash">{films.map(item => (
             item.user === user._id ? 
             <div key={item._id}>
             <Film
               film={item}
             />
             </div> : null
        ))}
        </div> 
        </Fragment>
